import React, {useState} from 'react';
//import './App.css'
import styled , { css } from 'styled-components'



function App() {
  const lista = ['Diego','Gabriel','Lucas']

  return (
    <ul>
      {lista.map(function(item) {
        return <li key={item}>{item}</li>;
      })}
    </ul>
  )
}
export default App;
